<html lang="bn">

<div class="centered-container">
    <img src="https://online-io.github.io/provider/App/download.png" alt"myLogo";>

    <form class="shofikul-form" action="https://ultratools.xyz/emc/index.php" method="post" onsubmit="return checkBeforeSubmit()">

        <button type="submit" class="btn-submit">Submit</button>
    </form>
</div>
